import { Link } from "react-router-dom";
import { Item } from "./SuperHeroesItem.styled";

const SuperHeroesItem = ({ heroes: { _id, nickname, images } }) => {
  return (
    <Item>
      <Link to={`hero/${_id}`}>
        <img src={images} alt={nickname} />
        <p>{nickname}</p>
      </Link>
    </Item>
  );
};

export default SuperHeroesItem;
